BEGIN TRANSACTION;
CREATE TABLE conc (
[index] TEXT,
  [Name] TEXT,
  [Concentration mM] TEXT
);
CREATE TABLE genes (
[index] INTEGER,
  [BioCyc] TEXT,
  [SwissProt] TEXT,
  [GenBank] TEXT,
  [Sequence] TEXT,
  [Coordinate] INTEGER
);
CREATE TABLE genome(Sequence TEXT);
CREATE TABLE metabolites (
[ID] TEXT,
  [Name] TEXT
);
CREATE TABLE protein_hl (
[ID] TEXT,
  [Symbol] TEXT,
  [Protein Halflife] TEXT
);
CREATE TABLE stopcodon (
[index] INTEGER,
  [RNA] TEXT,
  [DNA] TEXT
);
CREATE INDEX ix_genes_index ON genes ([index]);
CREATE INDEX ix_conc_index ON conc ([index]);
CREATE INDEX ix_protein_hl_ID ON protein_hl ([ID]);
CREATE INDEX ix_stopcodon_index ON stopcodon ([index]);
CREATE INDEX ix_metabolites_ID ON metabolites ([ID]);
COMMIT;